import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Modal, SectionList, StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Modal visible={true} transparent onRequestClose={()=>{}}>
        <View style={styles.modal}>
          <View style={{width:200, height:100,backgroundColor:'lightblue'}}>
            <Text>modal</Text>
          </View>
        </View>
      </Modal>
      <SectionList
        sections= {[
          {title:'Mobile', data:['iPhone x','iPhone 12']},
          {title:'Laptops', data:['hp','mac']},
        ]}
        ListHeaderComponent={<View><Text>big header</Text></View>}
        renderItem={({item})=><View><Text>{item}</Text></View>}
        renderSectionHeader={({section:{title}})=><View><Text style={{color:'red'}}>{title}</Text></View>}
        />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  modal:{
    fkex:1,

  },
});
